import React from 'react';
import './App.css';
// react router 
import { Routes, Route } from 'react-router-dom';
// pages
import Home from './pages/Home';

function App() {
     return(
          <div className='App'>
               <Routes>
                    <Route path='/' element={<Home />} />
               </Routes>
          </div>
     );
}

export default App;
